import React from 'react'
import { BrowserRouter as Router, Route } from 'react-router-dom'
import Search from './Search'

const App: React.FC = () => {
  return (
    <Router>
      <div style={{display: 'flex'}}>      
        <Route path="/" exaxt component={Search} />
      </div>
    </Router>
  );
}

export default App;
